ing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains."</p>', 1, '1617454334_606864feb4b2e.png', '300|900', 'C:\\xampp\\htdocs\\catatancoding-laravel\\storage\\app/public/images', 0, 1, 23, '2021-03-28 08:39:49', '2021-04-04 13:37:16', NULL),
(12, 'PyYSGb5hau5KBA7yRr32Gql8ruGQtR3J5mExWzl8PxuNnu4I83oomeDVZNc7oMrvkBRgVy8x51S1ALkvNJaEPvmTrNMCRFZ33WY6', 'If you use this site regularly and would like to help', 'if-you-use-this-site-regularly-and-would-like-to-help', 'If you use this site regularly and would like to help', 'If you use this site regularly and would like to help', 2, '<p><span style="font-family: "Open Sans", Arial, sans-serif; font-size: 14px; text-align: justify;">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using ''Content here, content here'', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for ''lorem ipsum'' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span></p><h2 style="margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-family: DauphinPlain; font-size: 24px; line-height: 24px;">Where can I get some?</h2><p style="margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: "Open Sans", Arial, sans-serif; font-size: 14px;">There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don''t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn''t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</p><p style="margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: "Open Sans", Arial, sans-serif; font-size: 14px;"><br></p><h2 style="margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-family: DauphinPlain; font-size: 24px; line-height: 24px;">Where does it come from?</h2><p style="margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: "Open Sans", Arial, sans-serif; font-size: 14px;">Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of "de Finibus Bonorum et Malorum" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, "Lorem ipsum dolor sit amet..", comes from a line in section 1.10.32.</p><p style="margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: "Open Sans", Arial, sans-serif; font-size: 14px;">The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from "de Finibus Bonorum et Malorum" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p><p><br></p>', 3, '1617454239_6068649f5d858.png', '300|900', 'C:\\xampp\\htdocs\\catatancoding-laravel\\storage\\app/public/images', 0, 1, 7, '2021-03-28 08:40:53', '2021-04-23 02:54:00', NULL),
(13, 'iZaWTkvqe0s9xQZOyt4cN6PnHkXEfEIvFG8JVXamWmLGA5stnQHrjCV2NDBJpggeMlqMI1h0F1KKYo3yY3T9bic6DLCPo84xRlzj', 'Mengenal Bootstrap', 'mengenal-bootstrap', 'Bootstrap Tutorial', 'Mengenal Bootstrap', 1, '<p style="text-align: justify;">     Sebelumnya saya sampaikan terima kasih sudah berkunjung diportal tutorial Catatan Koding, pada kesempatan kali ini kita akan membahas tentang Bootstrap.</p><p style="text-align: justify;">Menurut <i>Wikipedia</i> Bootstrap (Kerangka Kerja) adalah kerangka kerja CSS yang sumber terbuka dan bebas untuk merancang situs web dan aplikasi web. Kerangka kerja ini berisi templat desain berbasis HTML dan CSS untuk tipografi, formulir, tombol, navigasi, dan komponen antarmuka lainnya, serta juga ekstensi opsional JavaScript. Tidak seperti kebanyakan kerangka kerja web lainnya, kerangka kerja ini hanya fokus pada pengembangan front-end saja.</p><p style="text-align: justify;">Kerangka Kerja atau biasa disebut <i>Framework</i> adalah sebuah kerangka yang bisa digunakan untuk mempermudah pekerjaan kita. nah karna pembahasan kali ini tentang <i>framework</i> CSS maka <i>framework</i> Bootstrap akan mempermudah dalam menuliskan perintah CSS.</p><p style="text-align: justify;">Sampai disini apakah kalian sudah mulai paham. Jika kalian ada yang belum tahu apa itu CSS maka ada baiknya anda mempelajari CSS terlebih dahulu sebelum masuk kepembahasan ini. anda bisa liat di CSS Tutorial.</p><p style="text-align: justify;">Dalam Bootstrap sudah disediakan perintah untuk memanggil perintah CSS dan untuk menggunakan library Bootstrap anda hanya perlu memanggil kelas nya saja. tentunya sesuaikan dengan kebutuhan <i>layout web</i> yang ingin anda buat.</p><p style="text-align: justify;"><span style="font-weight: bolder;">Sejarah Bootstrap </span></p><p style="text-align: justify;">Bootstrap pada awalnya dibuat dan dikembangkan oleh pekerja atau programmer Twitter yaitu Mark Octo dan Jacob Thornton sejak 2011. </p><p style="text-align: justify;">Pada waktu itu programmer ditwiter menggunakan berbagai alat dan perpustakaan yang mereka kuasai dan sukai untuk melakukan pekerjaan mereka , sehingga tidak ada standarisasi dalam penamaan kelas.</p><p style="text-align: justify;">Akibatnya sulit untuk dikelola, oleh karena itu keduanya membuat alat atau kerangka kerja yang bisa digunakan bersama dilingkungan kerja internal Twitter.</p><p style="text-align: justify;">Bootstrap diluncurkan pada bulan agustus 2011 dan telah berkembang dari proyek berbasis CSS menjadi kerangka kerja yang lebih lengkap yang juga bersisi plugin javascript, ikon, formulir, dan tombol.</p><p style="text-align: justify;"><span style="font-weight: bolder;">Fungsi dan kegunaan Boostrap</span></p><p style="text-align: justify;">Beberapa fungsi yang dimiliki bootstrap antara lain :</p><ul><li style="text-align: justify;">Membantu dalam membuat dan merancang yang cepat dan responsive. tampilan suatu web yang dibuat dengan menggunakan bootstrap akan langsung menyesuaikan dengan ukuran layar pada browser.</li><li style="text-align: justify;">Membantu dalam membuat dan mengembangkan sebuah website yang dinamis ataupun statis.</li><li style="text-align: justify;">Menyediakan berbagai antar muka kelas yang berguna membantu situs web lebih ringandan cepat saat diakses.</li><li style="text-align: justify;">Membantu dalam pengaturan tata letak halaman website, hal ini karena bootstrap sudah dilengkapi fitur grid.</li><li style="text-align: justify;">Anda juga bisa menambahkan CSS maupun kelas sendiri, dengan begitu anda bisa mendesain tampilan website anda jadi lebih variatif. </li></ul><p style="text-align: justify;"><span style="font-weight: bolder;">Kelebihan dan kekurangan Bootstrap</span></p><p style="text-align: justify;">Suatu sistem atau program pastilah mempunyai kelebihan dan kekurangan yang dimiliki begitu juga dengan bootstrap.</p><p style="text-align: justify;">Berikut adalah  kelebihan dari Bootstrap.</p><ol><li style="text-align: justify;">Bisa membantu mempercepat penyelesaian ketika membuat front-end pada website.</li><li style="text-align: justify;">Tampilan yang modern sehingga membuat website anda lebih menarik.</li><li style="text-align: justify;">Membuat situs website menjadi lebih responsive karena bisa menyesuaikan ukuran layar pada device yang anda gunakan.</li><li style="text-align: justify;">Website menjadi lebih ringan saat digunakan.</li><li style="text-align: justify;">Dengan Boostrap anda bisa mendapatkan semua jenis warna, operasi penggunaan, dan juga berbagai variabel yang anda butuhkan. Jadi, anda tidak perlu kwatir lagi hasilnya sudah tentu tidak akan berlainan ketika dibuka diperangkat yang berbeda.</li><li style="text-align: justify;">Bootstrap diketahui lebih lengkap, hal ini karna bootstrap sudah mencakup CSS, HTML dan juga JAVASCRIPT</li><li style="text-align: justify;">Open source, artinya anda tidak perlu harus mendapatkan lisensi dan bahkan anda bisa mengembangkan website anda sesuai kebutuhan anda.</li><li style="text-align: justify;">Kerangka kerja yang dimiliki Bootstrap menggunkan Less. Less merupakan teknologi CSS yang terkenal akan kemudahannya. Less menawarkan banyak fleksibilitas dan juga kekuatan.</li></ol><p style="text-align: justify;">Kekurangan <span style="font-size: 1rem;">Bootstrap</span></p><ol><li style="text-align: justify;"><span style="font-size: 1rem;">Karena menggunakan CSS3, Bootstrap minimal</span></li><li style="text-align: justify;"><span style="font-size: 1rem;">Karena terlalu fokus pada coding, sehingga membuat kita kurang kreatif dalam mendesain website yang kita inginkan.</span></li><li style="text-align: justify;"><span style="font-size: 1rem;">Bootstrap belum mampu untuk bisa menampilkan tampilan website yang sama disemua browser.</span></li></ol><p style="text-align: justify;"><span style="font-size: 1rem;"><span style="font-weight: bolder;">Penutup</span></span></p><p style="text-align: justify;">Demikian sedikit penjelasan tentang Boostrap setidaknya anda sebelum masuk belajar Boostrap anda mesti mengenal apa itu Boostrap. Untuk artikel selanjutnya kita akan belajar bagaimana cara menginstall Boostrap.</p><p style="text-align: justify;">Terima kasih.</p>', 9, '5eeb1b125380df88522d1637409aa3d2.png', '', '', 0, 1, 0, '2021-04-25 07:27:55', '2021-05-19 01:03:45', NULL);
INSERT INTO `articles` (`id`, `random_id`, `title`, `slug`, `keywords`, `description`, `user_id`, `content`, `category_id`, `images`, `dimensions`, `path`, `setting_slider`, `status_publish`, `hits`, `created_at`, `updated_at`, `deleted_at`) VALUES
(14, 'gNRhnkLCMQ3zle31UzrEfjxaB0S5BegncTYbHi6P1r95Pa7VWNtvuhVJCcD6OSy88fZsZtyKMu294GmdpEDlkIwJYRUIbdXQxjHw', 'Cara menginstall SQLLite', 'cara-menginstall-sqllite', 'Cara menginstall SQLLite', 'Cara menginstall SQLLite', 1, '<p>Kembali lagi dengan Catatan Koding, Kali ini saya akan mencoba menulis bagaimana install SQLLite  </p><p>SQLLIte  merupakan sebuah sistem manajemen basisdata relasional yang bersifat ACID-compliant dan memiliki ukuran pustaka code yang relative kecil, ditulis dalam bahasa C.</p><p><span style="font-size: 1rem;">Download file ZIP di situ ini </span><a href="https://www.sqlite.org/index.html" target="_blank">sqlite.org</a></p><p><span style="font-size: 1rem;">Sesuaikan dengan OS yang kalian gunakan disini saya menggunakan Windows, download pada bagian </span><b style="font-size: 1rem;">Precompiled Binaries for Windows</b></p><p><b>        </b><img src="data:image/jpeg;base64," style="width: 713.491px; height: 348.719px;" data-filename="AWAL1.jpg"></p><p>Extract file zip kedalam local disk C (C:\\>sqlite3)  dan rename file tersebut denga nama <b>sqlite3</b>, kira-kira akan terlihat seperti dibawah ini..</p><p><img src="data:image/jpeg;base64," style="width: 802px;" data-filename="WIN1.jpg"></p><p>Kemudian buka environment variabels lalu cari <b>Path </b>kemudian klik <b>edit</b>, tambahkan C:\\sqlite3 seperti pada gambar dibawah ini.</p><p><img src="data:image/png;base64," style="width: 1367px;" data-filename="SS.png"><br></p><p>Buka CMD untuk melihat version sqlite</p><p><img src="data:image/png;base64," style="width: 1009px;" data-filename="SS.png"><br></p>', 12, 'f44379542fe2610c2930636c666d0729.png', '', '', 0, 1, 0, '2021-04-29 06:08:21', '2021-05-25 01:14:39', NULL);
