(1, 'VpNzDWRblANKKYp3uIHPLnkKRciiHTSTT5goQVjTZPCrlEgoGwKSEj4Kk7vsQ93PxdheHO2cYGzcH5QVQ16K51k6YO9thXQClW83', 'Curabitur porttitor nulla id sapien tristique', '<p><span style="color: rgb(33, 37, 41); font-family: Barlow; font-size: 14px; text-align: justify;">Aliquam iaculis, nisl eu dictum vulputate, ipsum nisi volutpat urna, id mattis diam nunc a velit. Nulla facilisi. Sed turpis elit, convallis nec nisl bibendum, dictum iaculis tortor. Nunc ultricies finibus metus quis lobortis. Cras dapibus odio eget orci maximus, sed gravida turpis ullamcorper. In a lectus consectetur velit blandit faucibus eu maximus nunc. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Aenean erat tortor, porta ut sollicitudin a, eleifend in velit. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Nam sodales erat </span><br></p>', 'undrawonlinecvqy9w_1617541928.png', 1, '2021-04-04 13:12:09', '2021-04-04 13:48:57', NULL),
(2, 'KRdgEGePOjtRQYqEIqfnpShAwsE0nkekSxk32vAJOEdIKkllBK5Y5G0zFYCyqfrkgXlKhLwW2N7tfHG4vHnABbOzLEJjrW4979ak', 'Sistem Payroll', '<p style="text-align: justify; "><font color="#212529" face="Barlow"><span style="font-size: 14px;">Salah satu sistem yang pernah kita bangun adalah sistem e-payroll proses bisnis yang kita buat adalah dari proses masuk data pegawai serta data presensi yang ditarik dari mesin fingerprint, file diupload kedalam sistem maka sistem otomatis akan menghitung kehadiran tiap pegawai.</span></font></p><p style="text-align: justify; "><font color="#212529" face="Barlow"><span style="font-size: 14px;">Setelah proses presensi selesai maka tahap selanjutnya adalah proses gaji, untuk BPJS Ketenagakerjaan serta BPJS Kesehatan akan dipotong secara otomatis, jika sudah selesai tahap gaji maka slip gaji bisa dikirim via email.</span></font></p>', 'e5788e6dca2f49c71af04d342f7e79e8.jpg', 1, '2021-04-04 13:17:24', '2021-05-25 01:30:15', NULL);
INSERT INTO `profiles` (`id`, `slug`, `user_id`, `about`, `image`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Kqhmp1ZCdCA6u2ssDTCySWECpJ5kuZjh2x7BUV82mlWCI4jOEvfE8y4czBpGr0ffDxCVT4cZTOQmVXUUszU2J4aXDku2R0JeLrcV', 1, '<p style="text-align: justify;"><span style="color: rgb(33, 37, 41); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;">&nbsp; &nbsp; &nbsp; &nbsp; Saya biasa dipanggil awi disini saya mulai belajar untuk menulis setiap kasus yang saya alami dibidang programming khususnya meskipun masih banyak yang harus terus saya pelajari tentunya dibidang ini, saya akan terus berusaha setiap kesulitan yang saya alami untuk bisa terpecahkan tentunya tidak lepas dari pencarian contoh kasus di internet untuk bisa memecahkan masalah yang saya alami untuk bisa diterapkan diprojek yang saya buat.</span></p><p><span style="font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;"><font color="#212529">Buat saya </font><b style=""><font color="#ce0000">"<i style="">Setiap catatan adalah pengingat saat dibutuhkan</i>"</font><font color="#212529"> </font></b><font color="#212529">maka dari itu saya akan terus berusaha untuk mencatat setiap kesulitan yang pernah saya alami di bidang pemrograman dan dituangkan dalam bentuk artikel</font></span></p><p><span style="font-family: Arial; font-size: 14px;">Selain itu saya akan mencoba membuat artikel tutorial yang mungkin buat para pencari tutorial sangat bisa membantu bagi kalian yang sedang atau baru belajar dibidang programming tentunya yang saya buat berdasarkan keahlian programming yang saya miliki.</span></p>', 'IMG202102241311401_1617417792.jpg', '2021-04-02 05:15:49', '2021-04-03 02:43:12', NULL),
(2, 'vPmBggNVwcKf6NqpVcLFPjMZ3COkynoxb9mGdaxNFPjPocZmYOGOXgXAdcHJo9n5s4L2FE9w5B3T7sOc7Dg32i3lxHbFntZXOWCj', 2, '<p><span style="color: rgb(33, 37, 41); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;">Proin enim diam, vehicula a lorem non, ullamcorper ornare ex. Maecenas vitae metus vel lorem aliquet rhoncus ac quis nisi. Cras mollis quam tincidunt lectus semper, et viverra nisi feugiat. Aliquam ac vulputate neque. Pellentesque fermentum, est et facilisis vestibulum, ex velit viverra massa, quis suscipit tortor odio eget purus. Aenean id rhoncus odio. Pellentesque vitae dui in dui malesuada porta. Ut aliquet consectetur libero, sed bibendum odio congue convallis. Fusce aliquam turpis accumsan, rhoncus arcu vel, placerat risus. Vestibulum vitae dolor vitae erat varius aliquam at eget augue. Aliquam feugiat diam in odio sagittis, quis consequat diam facilisis. Donec mollis suscipit rutrum. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Proin eget dui dui. Interdum et malesuada fames ac ante ipsum primis in faucibus. Integer vel ullamcorper ipsum.</span><br></p>\r\n\r\n<pre class="bg-light p-3"><font color="#104a5a">img.profile{</font><font color="#ff9c00">\r\n  width: 100%;\r\n  aspect-ratio:4/3;\r\n  object-fit: cover;\r\n  background-color: #e9e9e9;\r\n  background-repeat: no-repeat;\r\n  background-position: 50%;\r\n</font><font color="#104a5a">}</font>\r\n\r\n</pre>', 'IMG20210224131050_1617417446.jpg', '2021-04-02 05:16:07', '2021-04-03 02:37:26', NULL);
